import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [edit, setEdit] = useState(false);
  const [profile, setProfile] = useState({ name: '', bio: '' });
  const [success, setSuccess] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    console.log('Dashboard mounted');
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/signin');
      return;
    }
    fetch('http://localhost:5000/api/users/me', {
      headers: { 'Authorization': `Bearer ${token}` }
    })
      .then(res => {
        if (!res.ok) throw new Error('Failed to fetch user');
        return res.json();
      })
      .then(data => {
        console.log('User fetched from backend', data);
        setUser(data);
        setProfile({ name: data.name || '', bio: data.bio || '' });
        setLoading(false);
      })
      .catch(err => {
        console.log('Fetch failed, using mock user');
        setError(null);
        setUser({
          name: 'Demo User',
          email: 'demo@example.com',
          role: 'creator',
          bio: 'This is a demo user profile.'
        });
        setLoading(false);
      });
  }, [navigate]);

  const handleEdit = () => setEdit(true);
  const handleChange = e => setProfile({ ...profile, [e.target.name]: e.target.value });
  const handleSave = async e => {
    e.preventDefault();
    setSuccess(null);
    setError(null);
    try {
      const token = localStorage.getItem('token');
      const res = await fetch('http://localhost:5000/api/users/me', {
        method: 'PATCH',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        },
        body: JSON.stringify(profile)
      });
      if (!res.ok) throw new Error('Failed to update profile');
      const data = await res.json();
      setUser(data);
      setEdit(false);
      setSuccess('Profile updated!');
    } catch (err) {
      setError(err.message);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/signin');
  };

  if (loading) return <div className="dashboard-loading">Loading...</div>;
  if (error) return <div className="dashboard-error">{error}</div>;
  if (!user) return null;

  return (
    <div className="dashboard-root">
      <button style={{ float: 'right' }} onClick={handleLogout}>Logout</button>
      <h1>Welcome, {user.name || user.email}!</h1>
      <p>Role: <b>{user.role}</b></p>
      <div className="dashboard-section">
        {user.role === 'creator' && <div>Creator dashboard features coming soon...</div>}
        {user.role === 'brand' && <div>Brand dashboard features coming soon...</div>}
        {user.role === 'agency' && <div>Agency dashboard features coming soon...</div>}
      </div>
      <div className="dashboard-profile">
        <h2>Your Profile</h2>
        {edit ? (
          <form onSubmit={handleSave}>
            <input name="name" value={profile.name} onChange={handleChange} placeholder="Name" />
            <textarea name="bio" value={profile.bio} onChange={handleChange} placeholder="Bio" />
            <button type="submit">Save</button>
            <button type="button" onClick={() => setEdit(false)}>Cancel</button>
          </form>
        ) : (
          <>
            <div><b>Name:</b> {user.name}</div>
            <div><b>Bio:</b> {user.bio}</div>
            <button onClick={handleEdit}>Edit Profile</button>
          </>
        )}
        {success && <div className="dashboard-success">{success}</div>}
        {error && <div className="dashboard-error">{error}</div>}
      </div>
    </div>
  );
};

export default Dashboard;
